  test('today', () => {
    const dateGallery: DateGallery<string> = new DateGallery({
      mode: 'day',
      initialDate: '1980-05-03 00:00',
    });
    const subscriber = autoSubscribe(dateGallery);

    dateGallery.today();

    expect(subscriber).toHaveBeenCalledTimes(1);
    assertLastSubscriber(
      subscriber,
      {
        history: [],
        isUTC: false,
        numberOfFrames: 1,
        mode: 'day',
        firstDayOfWeek: 0,
        firstFrame: frameToTestFrame(dateGallery.frames[0]),
        frames: [
          {
            anchorDate: 'za 01-01-2000 00:00',
            dates: [
              {
                date: 'za 01-01-2000 00:00',
                events: [],
                hasEvents: false,
                hasEventsWithOverlap: false,
                isPadding: false,
                isSelected: false,
                canBeSelected: true,
                isToday: true,
              },
            ],
            events: [],
          },
        ],
        events: [],
        selectedDates: [],
        maxSelectionLimit: false,
        maxSelectionLimitBehavior: 'circular',
      },
      {
        type: 'CONFIG_CHANGED',
        mode: 'day',
        numberOfFrames: 1,
        anchorDate: new Date('2000-01-01 00:00'),
        frames: dateGallery.frames,
        time: new Date(),
      }
    );
  });
